body {
  font-family: Iosevka, Gordita, Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans",
    "Helvetica Neue", sans-serif;
  background-color: #1e1e2e;
  color: #cdd6f4;
  font-size: 1rem;
}

.circle {
  border-radius: 100%;
}

.profile-pic {
  width: 200px;
}

main {
  text-align: center;
  padding: 1em;
  margin: 0 auto;
}

h1 {
  color: #ffffff;
  text-transform: uppercase;
  font-size: 3rem;
  /* font-weight: 100; */
  font-weight: normal;
  line-height: 1.1;
  /* margin: 4rem auto; */
  margin: auto;
  /* max-width: 14rem; */
}

p {
  margin: 1em auto;
  line-height: 1.35;
}

@media (min-width: 480px) {
  h1 {
    font-size: 4rem;
  }

  p {
    max-width: none;
  }

  body {
    font-size: 1.3rem;
  }
}

@media (min-width: 1080px) {
  .profile-pic {
    width: 400px;
  }
}

